import React from 'react';
import './Node.css';

const Node = ({ centX, centY }) => {

	var circRadius = 150;

	// add the 'px' and convert cx, cy and circRadiusto strings
	var cx_str = centX + 'px';
	var cy_str = centY + 'px';
	var circRadius_str = circRadius + 'px';
	//var bordradius_str = (circRadius/2) + 'px';

	// overwrite width, height and border-radius styles
	var circStyles = {
		marginTop: cy_str,
		marginLeft: cx_str,
    	width: circRadius_str,
    	height: circRadius_str,
		borderRadius: '50%',
		background: 'grey',
	};


	return (
		<div style = {circStyles}>			
		</div>
	);
}

export default Node;
